import React, { Component } from "react";
import Link from "next/link";
import Layout from "../../../src/components/projectPages/projectLayout";

class App extends Component {
  state = {};
  render() {
    return (
      <div
        style={{
          fontFamily: "Courier New, Courier, monospace",
        }}
      >
        <container>
          <Link href="/" as={`/`}>
            <button className="absolute top-0 left-0 m-4 px-3 bg-gray-400 opacity-50 hover:opacity-75 rounded-full border-black border">
              back
            </button>
          </Link>

          <img
            src="/img/projectPictures/soloStander/landing.png"
            alt="solo stander"
          />
        </container>
        <div className="container m-20">
          <div>
            <h1 className="text-4xl text-gray-600">Background:</h1>
            <p>
              There are 265,000 people with a spinal chord injury in the United
              States alone. When faced with this difficult challenge, almost
              everyone feels as they have lost a key part of their independence.{" "}
            </p>
          </div>
        </div>
      </div>
    );
  }
}

export default App;
